import React from 'react';

const MenuPage = ({ categories, showProducts, goBack }) => {
  return (
    <div>
      <h1>Menu</h1>
      <div className="categories-container">
        {categories.map(category => (
          <div key={category} className="category-item">
            <button onClick={() => showProducts(category)} className="category-button">
              <img src="your-image-url-here" alt="Category" className="category-image" />
              {category}
            </button>
            <div className="menu-details">
              <h2>Menu Details</h2>
              <p>Name: Menu Item Name</p>
              <p>Price: Menu Item Price</p>
              <p>Description: Menu Item Description</p>
            </div>
          </div>
        ))}
      </div>
      <button onClick={goBack}>Back to Landing Page</button>
    </div>
  );
};

export default MenuPage;
